import Header from "../components/Header";
import Sidebar from "../components/Sidebar";
import TaskTable from "../components/TaskTable";
import QuoteCard from "../components/QuoteCard";

export default function Home() {
  const todaysTasks = [
    { name: "Finish React project", done: false },
    { name: "Read 10 pages of book", done: true },
  ];

  const weeklyTasks = [
    { name: "Prepare presentation", done: false },
    { name: "Workout 3 times", done: false },
  ];

  return (
    <div className="min-h-screen bg-[#fafafa] text-gray-800">
      <Header />
      <div className="grid grid-cols-4 gap-6 px-10">
        <Sidebar />
        <main className="col-span-2 space-y-6">
          <TaskTable title="TODAY'S TASKS" tasks={todaysTasks} />
          <TaskTable title="WEEKLY TASKS" tasks={weeklyTasks} />
        </main>
        <QuoteCard />
      </div>
    </div>
  );
}
